import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');


class Test extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: ''
		}
	}

	getImage = () => {
		const client = new AccountClient('http://localhost:8080');
		const request = new imageData();
		// request.getImage();
		client.imageTest(request, {}, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				console.log(reply.getImage_asB64());
				const aa = reply.getImage_asB64();
				console.log(`a is ${aa}`)
				// this.setState({image: aa})
				console.log(this.state.image)
				return aa;
			}

		})

	}

	render() {
			const data = this.getImage();
		// const data = ''
			// const data = ''
			// console.log(`aaa ${data}`);
			const Example = ({ data }) => <img src={`data:image/jpeg;base64,${data}`} />

		return (
			<div>
				{/* {/* <a data={this.state.image} /> */}
				{/* {document.getElementById('container')} */}
				<Example data={data} />
				{document.getElementById('container')}
				<div id="container"></div>
				<div>test page</div>
			</div>
		)
	}
}

export default Test;
